import React from "react";
import ReactDOM from "react-dom/client";
import "./index.scss";
import App from "./App";
import { initializeApp } from "firebase/app";
import { getAuth } from "firebase/auth";
import { FirebaseConfig } from "./context/FirebaseContext";

const firebaseConfig = {
  apiKey: "AIzaSyBz-fgdbtXjmWia4ylpLyw-2uHLg5Voi1A",
  authDomain: "restoran-27302.firebaseapp.com",
  projectId: "restoran-27302",
  storageBucket: "restoran-27302.appspot.com",
  messagingSenderId: "703917728319",
  appId: "1:703917728319:web:cbe057f631be1aeece0e8a",
};

const app = initializeApp(firebaseConfig);
const auth = getAuth(app);

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <FirebaseConfig.Provider value={{ app, auth }}>
    <App />
  </FirebaseConfig.Provider>
);
